import React from 'react'


function HeaderToggle() {
    onClick = (e) => {
        e.preventDefault()
        console.log('onclick..')
      }
    return (
        <div class="header-toggle d-lg-none">
            <a class="menu-toggle" href  onClick={this.onClick}  >
                <span></span>
                <span></span>
                <span></span>
            </a>
        </div>
)
}

export default HeaderToggle
